import React from 'react';
import './Nav.css'
import {Link} from 'react-router-dom';
import CenteredTabs from './CenteredTabs';

function Nav() {

  return (
    <div>
      <nav>
      <CenteredTabs />
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/schedule">Schdule</Link>
            </li>
          </ul>
      </nav>
    </div>
  );
}

export default Nav;
